    function getBaseSvtData(no) {        
        let sid = getSid(no);
        let a = getSvtNpRate(no);
        let b = getSvtClassAddition(no);
        let c = getSvtNpAddition(no);
        let d = getSvtSkillAddition(no);
        let mySvt = mstSvtBaseData[sid];
        if(mySvt.collectionNo==107)mySvt.combineMaterialId=0;
        let baseData = {
            'site': 1,
            'npLv': 1,
            'isNPEX': 0,
            'individuality': mySvt.individuality,
            'cno': mySvt.collectionNo,
            'cardIds': mySvt.cardIds,
            'class': numToClass[mySvt.classId],
            'classId':mySvt.classId,
            'attri': numToAttri[mySvt.attri],
            'name': mySvt.name,
            'battleName_cn': mySvt.battleName_cn,
            'combineMaterialId':mySvt.combineMaterialId,
            'rewardLv':mySvt.rewardLv,
            'atk': getAtk(no, mySvt.rewardLv),
            'hp': getHp(no, mySvt.rewardLv),
            'hpNow': 1,
            'lv':mySvt.rewardLv,
            'criStarRate': mySvt.starRate / 10,
            'oc':1,
            "isEnforceSp": 0,
            'npRate': {
                'A': a.npbaseA / 100,
                'B': a.npbaseB / 100,
                'Q': a.npbaseQ / 100,
                'EX': a.npbaseEx / 100,
                'NP': a.npbase / 100
            },
            'hit': {
                'A': a.artsHit,
                'B': a.busterHit,
                'Q': a.quickHit,
                'EX': a.exHit,
                'NP':c[0].damage.length
            },
            'noblePhantasm': c,
            'skill': d,
            'permBuff': b,
            'tempBuff': {}
        }
        //log(getJsonValue(baseData));
        return getJsonValue(baseData);
    }

    let mstSvtCardIds = {
        1:"A",
        2:"B",
        3:"Q"
    }
    
    function getCardIds(arr){
        let a = new Array();
        for(key in arr){
            let aa = arr[key];
            a.push(mstSvtCardIds[aa]);
        }
        return a;
    }    
    
    function getSvtNpRate(no) {
        let sid = getSid(no);
        let hits = mstSvtBaseData[sid].cardHits;
        let npRate = mstSvtBaseData[sid].npRate;    
        let a = {
            artsHit: hits[1].length,
            busterHit: hits[2].length,
            quickHit: hits[3].length,
            exHit: hits[4].length,
            npbase: npRate.tdPoint,
            npbaseA: npRate.tdPointA,
            npbaseB: npRate.tdPointB,
            npbaseQ: npRate.tdPointQ,
            npbaseEx: npRate.tdPointEx,
            npbaseDef: npRate.tdPointDef
        }

        return a
    }
